import React from "react";



class Home extends React.Component {

  state = {
    img: "",
    countLike: 0,
    countDislike: 0,
  }
  render() {
    console.log(this.state)
    return (
      <div className="container text-center">
        <h1>Make New Friends</h1>
        <p>
          Thumbs up on any pups you'd like to meet!
        </p>
        <img src={this.state.img.message}></img>
        <div>
          <i onClick={this.likeThisPic} class="fas fa-thumbs-up"></i>
          <i onClick={this.dislikeThisPic} class="fas fa-thumbs-down"></i>
        </div>
        <div>You like {this.state.countLike} Dogs</div>
        <div>You Dislike {this.state.countDislike} Dogs</div>
      </div>
    );
  }

}

export default Home;
